import React from 'react';
import { useNavigate } from 'react-router-dom';
import {useLocation} from 'react-router-dom';
import { useEffect,useState } from 'react'

export default function ListingPage(){
    const next = useNavigate();
    const location = useLocation();
    const [value,setValue] = useState("");
    const [data, setData] = useState(null);

    function submitfn(params: string) {
      console.log(params);
      fetchData(params);
    }

    async function fetchData(params: string) {
        const response = await fetch("http://127.0.0.1:5000/hello"+"?busid="+params+"&end="+endval, {
          mode: 'cors'
        });
        const json = await response.json();
        setData(json);
        console.log(json);
    
        next('/listing',{state:json});
    }

    return <div>Home
        <button onClick={() => { next("/details") }}>lsitingpage</button>
        <div><div onClick={()=>submitfn("1")}>{location.state.buses_list[0].bus_id}</div>,{location.state.buses_list[0].Arr_Time},{location.state.buses_list[0].Dep_Time}</div>
        <div>{location.state.buses_list[1].bus_id},{location.state.buses_list[1].Arr_Time},{location.state.buses_list[1].Dep_Time}</div>

    </div>}
